import { useRouteLoaderData } from "react-router-dom";

import EventForm from "../components/EventForm";

const EditEvent = () => {
  const data = useRouteLoaderData();
  const event = data.event;
  return (
    <>
      <h1>Edit Event</h1>
      <EventForm event={event}></EventForm>
    </>
  );
};

export default EditEvent;
